      SELECT DISTINCT * FROM tab2 (FORMAT parquet) AS cor0 WHERE + 36 <= - col0 * + + CAST ( 69 AS REAL ) + + + col2 + - col1 + + + col0 AND NULL IN ( col0 );
  - name: tab2

outputs:
  - name: q12948.out
    data: |
